function filterUniqueById(listOfObjects: object[]) {
  const uniqueList = [];
  const map = new Map();
  for (const item of listOfObjects) {
    if (!map.has(item["id"])) {
      map.set(item["id"], true); // set any value to Map
      uniqueList.push(item);
    }
  }
  return uniqueList;
}

